query FairBoothHeaderTestsQuery {
  show(id: "anderson-fine-art-gallery-flickinger-collection") {
    ...FairBoothHeader_show
    __id
  }
}

fragment FairBoothHeader_show on Show {
  fair {
    name
    __id
  }
  partner {
    __typename
    ... on Partner {
      name
      id
      _id
      __id
      href
      profile {
        _id
        id
        is_followed
        __id
      }
    }
    ... on Node {
      __id
    }
    ... on ExternalPartner {
      __id
    }
  }
  counts {
    artworks
    artists
  }
  location {
    display
    __id
  }
  __id
}
